import React, { Component } from "react";
// import PropTypes from "prop-types";
import { connect } from "react-redux";
import { fetchSports } from "../actions/Actions";
import ListStructure from "../components/ListStructure";

class SportContainer extends Component {
  // constructor(props) {
  //   super(props);
  // }
  componentDidMount() {
    this.props.dispatch(fetchSports());
  }

  showObjects = (objects) => {
    return objects.map((object, index) => {
      return (
        <tr key={index}>
          <td width="200" align="left">
            <Button
              variant="link"
              style={{ color: "black" }}
            >
              {object.attributes.name}
            </Button>{" "}
          </td>
          <td width="200" align="left">
            {object.attributes.leagues.length}
          </td>
        </tr>
      );
    });
  };

  render() {
    return <><ListStructure objects={this.props.sports}/></>;
  }
}

SportContainer.propTypes = {};

function mapStateToProps(state) {
  const { sports } = state;
  return { sports };
}

export default connect(mapStateToProps)(SportContainer);
